    assert(date.gte(Date::new(2022, 12, 31)));
}

#[test]
fn test_date_lte() {
    let date = Date::new(2023, 1, 1);

    assert(date.lte(Date::new(2023, 1, 1)));
    assert(!date.lte(Date::new(2022, 12, 31)));
    assert(date.lte(Date::new(2023, 1, 2)));
}

